

const img = new Image();
img.src = "data:image/png;base64,"


img.addEventListener("load", () => {

    const cavnas = document.querySelector("canvas");
    const ctx = cavnas.getContext("2d");


    cavnas.width = 1000;
    cavnas.height = 800;
    ctx.drawImage(img, 0, 0, cavnas.width, cavnas.height);
    const pixels = ctx.getImageData(0,0,cavnas.width,cavnas.height);
    ctx.clearRect(0,0,cavnas.width,cavnas.height);
    let particlesArray = [];
    let numberOfParticles = 5000;
    let mappedImageData = [];
    for(let y = 0;y<cavnas.height;y++){
        let row = [];
        for(let x=0;x<cavnas.width;x++){
            const red = pixels.data[(y * 4 * pixels.width)+(x*4)];
            const green = pixels.data[(y * 4 * pixels.width)+(x*4+1)];
            const blue = pixels.data[(y * 4 * pixels.width)+(x*4+2)];
            const brigthness = calculateRelativeColor(red,green,blue);
            let cell = [
                cellBrightness  = brigthness,
            ]
            row.push(cell);
        }
        mappedImageData.push(row);
    }

    console.log(mappedImageData)

    



    function calculateRelativeColor(red,green,blue){
        return Math.sqrt(
            (red * red) * 0.299 + (green * green) * 0.587 + (blue * blue) * 0.114
        )/100;
    }
    class Particle {
        constructor() {
            this.x = Math.random() * cavnas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.05;
            this.size = Math.random() * 0.5 + 3;
            this.position1 = Math.floor(this.x);
            this.position2 = Math.floor(this.y);
        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImageData[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;
            if (this.y >= cavnas.height) {
                this.y = 0;
                this.x = Math.random() * cavnas.width;
            }
        }

        //draw 
        draw() {
            ctx.beginPath();
            ctx.fillStyle = "white";
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle)
        }
    }

    init();

    function animted() {

        ctx.globalAlpha = 0.05;
        ctx.fillStyle = "rgb(0,0,0)";
        ctx.fillRect(0,0,cavnas.width,cavnas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update()
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animted);
    }

    animted()
})